import React from 'react';
import './SeatList.css'
import "../../style.css";

export default function SeatList(props) {

    return (
        <React.Fragment>
            <div className="seat-content">
                {props.items.map(seat => (
                    <div key={seat.id}>
                        {console.log(seat.available)}
                        {seat.available ? (
                            <button className="seat-item available">
                                <h3>{seat.name}</h3>
                            </button>
                        ) : (
                            <button className="seat-item notavailable">
                                <h3>{seat.name}</h3>
                            </button>
                        )}
                    </div>
                ))}
            </div>
        </React.Fragment>
    );

};
